// 비동기 떄문에 async await 써서 데이터 가져오는 부분
// 서버로 데이터 가져올시 필요 없는 부분
async function test() { 
    const result = await listAPI();
    return result
}

function* list() {
    try {
        const result = yield call(test);// call 동기
        console.log(result)
        yield put({ // put은 dispatch 동일
            type: GET_LIST_SUCCESS,
            data : result // 비동기로 받아온 데이터 추가
        })
    }catch(e) { // listAPI 실패
        console.log(e);
        yield put({
            type: GET_LIST_FAILURE,
        })
    }
}

function* getList() {
    yield takeLatest(GET_LIST_REQUEST, list)
}

export default function* listSaga() {
    yield all([
        fork(getList),  // fork 비동기
    ]);
}